import './App.css';
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';


function App() {


  const Nav = () => {
    const [homeText, setHomeText] = React.useState("Home");
    const [operationText, setOperationText] = React.useState("Operation");
    const [memoryText, setMemoryText] = React.useState("Memory");
    const [space, setSpace] = React.useState("Space");
    React.useEffect(() => {
      const handleResize = () => {
        if (window.innerWidth <= 1400) {
          setHomeText("H");
          setOperationText('Op');
          setMemoryText('Me');
          setSpace('S')
        } else {
          setHomeText("Home");
          setOperationText('Operation');
          setMemoryText('Memory');
          setSpace('Space')
        }
      };

      window.addEventListener('resize', handleResize);
      handleResize();
      return () => {
        window.removeEventListener('resize', handleResize);
      };
    }, []);
    return (
      <div className='navDiv'>
        {/* <img className='logo' src={logo} alt='logo' style={{height: '50px', width: '50px', margin: '15px'}} ></img>
          <span><a href='/home'>{homeText}</a></span> &nbsp; 
          <span><a href='/operations'>{operationText}</a></span> &nbsp; 
          <span><a href='/memory'>{memoryText}</a></span> &nbsp; 
          <span><a href='/space'>{space}</a></span> */}
      </div>
    )
  }

  const BtmNav = () => {
    return (
      <div style={{width: 'calc(100vw - 100px)', backgroundColor: '#999999', height: '50px'}}>&nbsp;</div>
    )
  }

  return (
    <>
      <Nav></Nav>
      <BrowserRouter>
        <Routes>
        {/* <Route path='/' element={<Home/>}/>
          <Route path='/home' element={<Home/>}/>
          <Route path='/operations' element={<Operations/>}/>
          <Route path='/memory' element={<Memory/>}/>
          <Route path='/space' element={<Space/>}/> */}
        </Routes>
      </BrowserRouter>
      <BtmNav></BtmNav>
    </>
  );
}

export default App;
